import React from "react";
import avatar from "../assets/ayoub.jpeg";
import "../assets/NavBar.css";
function NavBar() {
	const onclick = () => {};
	return (
		<nav className="nav">
			<h3 className="nav__title">
				ToDo <span>List</span>
			</h3>

			<ul className="nav__list">
				<li>
					<a onClick={onclick.bind(this)} href="/">
						ToDo
					</a>
				</li>
				<li>
					<a href="/">Chat</a>
				</li>
				<li>
					<a href="/">About</a>
				</li>
				<li>
					<a href="/">ContactUs</a>
				</li>
			</ul>
			<img src={avatar} width="40px" />
		</nav>
	);
}

export default NavBar;
